import './App.css';

const name = "Abhirup";
const element = <h2>I am a SDE at Amazon</h2>

const Test = (name) => {
  return (
    <div>
      <h1>Test Succesful {name}</h1>
    </div>
  );
}

function App() {
  return (
    <div className='Main'>
      <h1>hello, I am {name}</h1>
      { element }
      <Test />
    </div>
  );
}

export default App;
